import React, { Component } from 'react';
  
export default class About extends Component {
  render() {
    return (
      <div>
        <h1>Bhaswati Das Gupta</h1>
        <p>Hi! My name is Bhaswati Das Gupta. I'm currently a rising sophomore at UC Santa Cruz. \n 
          Computer Science and minoring in Statistics. Some of my hobbies include playing the \n
          flute and dancing. In the future, I hope to go into machine learning or artificial \n
          intelligence. </p> 
      </div>
    )
  }
}
